/* 
    Login
    1 - need
    0 - only unlogged
    2 - don't nedd

*/

const Guard = (e: number = 2, window: any) => {
    console.log(window);
    console.log("ASDASD");
    
    if (e == 1 && !window.localStorage.getItem("token")){
        window.location.href = "/login"
        return
    }

    if (e == 0 && window.localStorage.getItem("token")){
        window.location.href = "/home"
        return
    }
}

export default Guard;
